// SPDX-License-Identifier:MIT
pragma solidity 0.8.21;

contract Bank{
    // 主要存入ETH，而非ERC20 token，最少完成這三個方法：Deposit , Withdraw , Check Balance

    mapping(address => uint) public balanceOf;

    modifier checkDeopsit(){
        require(msg.value > 0,"deposit must be than zero.");
        _;
    }

    modifier checkWithdraw(uint getValue){
        require(address(this).balance > 0,"bank is empty.");
        require(address(this).balance > getValue,"bank is empty.");
        require(balanceOf[msg.sender] > 0,"user don't have any money.");
        require(getValue <= balanceOf[msg.sender],"you can't get too more.");
        _;
    }

    function Deposit() checkDeopsit payable external returns(uint amount){
        balanceOf[msg.sender] += msg.value;
        amount = balanceOf[msg.sender];
    }

    // 問題出在 modifier，原因出在getValue >= balanceOf[msg.sender] 判斷有問題，輸入0.1又會有問題因為要輸入正整數。
    function Withdraw(uint getValue) external checkWithdraw(getValue){
        address payable receiver = payable(msg.sender);
        balanceOf[msg.sender] -= getValue;
        receiver.transfer(getValue);
    }
}

